/*Table structure for table `qo_matchs` */

DROP TABLE IF EXISTS `qo_matchs`;

CREATE TABLE `qo_matchs` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '赛事ID',
  `title` varchar(200) NOT NULL COMMENT '赛事名称',
  `content` longtext COMMENT '赛事内容',
  `contact_number` varchar(100) DEFAULT '' COMMENT '现场联系电话',
  `sign_start_time` int(10) NOT NULL DEFAULT '0' COMMENT '报名开始时间戳',
  `sign_end_time` int(10) NOT NULL DEFAULT '0' COMMENT '报名截止时间戳',
  `match_start_time` int(10) DEFAULT '0' COMMENT '比赛开始时间',
  `match_end_time` int(10) DEFAULT '0' COMMENT '比赛截止时间',
  `pay_end_time` int(10) DEFAULT '0' COMMENT '报名后付款截止时间',
  `next_back_number` int(10) DEFAULT '1' COMMENT '下一次编排的背号',
  `created_at` int(10) DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(10) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COMMENT='赛程表';

/*Data for the table `qo_matchs` */

insert  into `qo_matchs`(`id`,`title`,`content`,`contact_number`,`sign_start_time`,`sign_end_time`,`match_start_time`,`match_end_time`,`pay_end_time`,`next_back_number`,`created_at`,`updated_at`) values (1,'2016年广东省标准舞、拉丁舞年度总决赛 暨第十届珠江三角洲标准舞、拉丁舞公开赛 竞赛规程','&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;一、主办单位：&lt;/b&gt;佛山市禅城区文化体育局22\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;span&gt;广东省青少年舞蹈协会&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;二、承办单位：&lt;/b&gt;佛山市运动家文化策划有限公司\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;三、竞赛时间和地点：&lt;/b&gt;2016年12月25日在佛山市体育馆举行。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;四、竞赛规则：&lt;/b&gt;比赛分预赛、复赛、半决赛、决赛进行。&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;五、参赛报名规定：（&lt;/b&gt;&lt;span&gt;咨询电话：&lt;/span&gt;0757- 82361796，18928563168）\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;1、报名请登录&lt;/b&gt;&lt;a href=&quot;http://www.cwdance.cn&quot;&gt;&lt;b&gt;www.cwdance.cn&lt;/b&gt;&lt;/a&gt;&lt;b&gt;，&lt;/b&gt;&lt;b&gt;&lt;span&gt;在网站的&lt;/span&gt;“赛事通”中报名&lt;/b&gt;。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	2、报名日期：报名系统于12月3日12:00开启，12月11日24:00关闭。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	3、同一对精英组选手不能兼报参加多个精英组比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	4、已报双人精英组的同一对选手，不能兼报常规赛同龄双人组比赛，但可更换舞伴兼报常规赛同龄双人组比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	5、已报单人精英组的选手，不能兼报常规赛同龄单人组比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	6、双人组选手，是以年龄大的选手为准，报相应年龄组别比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;7、每名选手最多可兼报4个项目。注意，由此引起选手检录误场责任自负。&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;六、比赛服务费：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;span&gt;报名费必须于&lt;/span&gt;2016年12月17日前在报名系统中线上支付，或线下汇款(或转账)到组委会指定账户：\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span&gt;交通银行佛山分行，户名：陈莘，账号&lt;/span&gt;:&lt;/b&gt;&lt;b&gt;&amp;nbsp;6222 6237 1000 3511 859&lt;/b&gt;&lt;b&gt;，&lt;/b&gt;&lt;span&gt;报名表经赛会确认后，不得更改。若因特殊原因更改，则需缴纳更改费&lt;/span&gt;200元/组(项)。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;七、裁判、领队报到：&lt;/b&gt;&lt;b&gt; &lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	1、报到：各参赛领队于12月23日中午12:00前，报到，领取选手背号。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	2、裁判、领队会议：12月23日下午14:00召开裁判、领队会议。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	3、报到和裁判、领队会议地址：佛山市禅城区卫国路，佛山体育馆后座训练馆顶层，广东省青少年舞蹈协会（总部）佛山市禅舞培训中心。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	4、比赛日：2016年12月25日8:00，裁判员开赛前会议、选手8:00时开始检录，8:30时开始比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;八、比赛设项规定：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	◆ 标准舞系列：W 华尔兹、T 探戈、VW 维也纳华尔兹、F 狐步、Q 快步\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	◆ 拉丁舞系列：C 恰恰恰、R 伦巴、J 牛仔、S 桑巴、P 斗牛\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	5支舞：标准舞：W、T、VW、F、Q；拉丁舞：S、C、R、J、P 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	4支舞：标准舞：W、T、VW、Q；拉丁舞：S、C、R、J 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	3支舞：标准舞：公开组W、T、VW&lt;b&gt;&lt;span&gt;（少年组&lt;/span&gt;W、Q、VW）&lt;/b&gt;&lt;span&gt;；&lt;/span&gt; &lt;span&gt;拉丁舞：&lt;/span&gt;C、R、J 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	2支舞：标准舞：公开组W、T；少年组W、Q；拉丁舞：C、R 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;九、竞赛规定：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;1、&lt;/b&gt;&lt;b&gt;&lt;span&gt;锦标赛组别注明：不足&lt;/span&gt;6对选手参赛，比赛不发奖金；不足3对选手参赛，比赛取消。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	2、13岁或以下年龄组的服装和动作按规定执行。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:25.6000pt;&quot;&gt;\r\n	3、参加颁奖仪式选手须着比赛服装。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	4、参加各年龄组比赛的选手，必须随身携带身份证或户口本原件备查。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;5、比赛期间不接受选手投诉，投诉必须于比赛后由领队缴交500元投诉费，并以书面形式交仲裁委员会处理，投诉失败则不退还投诉费。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.5500pt;&quot;&gt;\r\n	6、参赛运动员禁用违禁药物。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.5500pt;&quot;&gt;\r\n	7、参赛运动员须由组队单位（或个人）购买比赛当日的意外保险；&lt;b&gt;谢绝患有疾病，特别是心脑血管及高血压疾病患者参赛&lt;/b&gt;；&lt;span&gt;若隐瞒病情参赛，则比赛期间一切意外事故的责任由选手自负，大赛组委会不承担任何后果及责任。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;十、本竞赛规程最终解释权属主办单位，未尽事宜，另行通知。&lt;/b&gt; \r\n&lt;/p&gt;','0755-26797798',1481040000,1481731200,1482336000,1483113600,1481990400,1,1481106546,1481110305),(2,'2016年广东省标准舞、拉丁舞年度总决赛 暨第十届珠江三角洲标准舞、拉丁舞公开赛 竞赛规程','11111','13578941597',1481040000,1482336000,1482336000,1483027200,1481385600,1,1481106546,1481106546),(3,'2016年广东省标准舞、拉丁舞年度总决赛 暨第十届珠江三角洲标准舞、拉丁舞公开赛 竞赛规程','111','18825271111',1480953600,1481644800,1481731200,1483027200,1483027200,1,1481106546,1481106546),(4,'2016年广东省标准舞、拉丁舞年度总决赛 暨第十届珠江三角洲标准舞、拉丁舞公开赛 竞赛规程','&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;一、主办单位：&lt;/b&gt;佛山市禅城区文化体育局22\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;span&gt;广东省青少年舞蹈协会&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;二、承办单位：&lt;/b&gt;佛山市运动家文化策划有限公司\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;三、竞赛时间和地点：&lt;/b&gt;2016年12月25日在佛山市体育馆举行。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;四、竞赛规则：&lt;/b&gt;比赛分预赛、复赛、半决赛、决赛进行。&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;五、参赛报名规定：（&lt;/b&gt;&lt;span&gt;咨询电话：&lt;/span&gt;0757- 82361796，18928563168）\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;1、报名请登录&lt;/b&gt;&lt;a href=&quot;http://www.cwdance.cn&quot;&gt;&lt;b&gt;www.cwdance.cn&lt;/b&gt;&lt;/a&gt;&lt;b&gt;，&lt;/b&gt;&lt;b&gt;&lt;span&gt;在网站的&lt;/span&gt;“赛事通”中报名&lt;/b&gt;。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	2、报名日期：报名系统于12月3日12:00开启，12月11日24:00关闭。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	3、同一对精英组选手不能兼报参加多个精英组比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	4、已报双人精英组的同一对选手，不能兼报常规赛同龄双人组比赛，但可更换舞伴兼报常规赛同龄双人组比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	5、已报单人精英组的选手，不能兼报常规赛同龄单人组比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	6、双人组选手，是以年龄大的选手为准，报相应年龄组别比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;7、每名选手最多可兼报4个项目。注意，由此引起选手检录误场责任自负。&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;六、比赛服务费：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;span&gt;报名费必须于&lt;/span&gt;2016年12月17日前在报名系统中线上支付，或线下汇款(或转账)到组委会指定账户：\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span&gt;交通银行佛山分行，户名：陈莘，账号&lt;/span&gt;:&lt;/b&gt;&lt;b&gt;&amp;nbsp;6222 6237 1000 3511 859&lt;/b&gt;&lt;b&gt;，&lt;/b&gt;&lt;span&gt;报名表经赛会确认后，不得更改。若因特殊原因更改，则需缴纳更改费&lt;/span&gt;200元/组(项)。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;&amp;nbsp;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;七、裁判、领队报到：&lt;/b&gt;&lt;b&gt; &lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	1、报到：各参赛领队于12月23日中午12:00前，报到，领取选手背号。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	2、裁判、领队会议：12月23日下午14:00召开裁判、领队会议。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	3、报到和裁判、领队会议地址：佛山市禅城区卫国路，佛山体育馆后座训练馆顶层，广东省青少年舞蹈协会（总部）佛山市禅舞培训中心。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	4、比赛日：2016年12月25日8:00，裁判员开赛前会议、选手8:00时开始检录，8:30时开始比赛。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;八、比赛设项规定：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	◆ 标准舞系列：W 华尔兹、T 探戈、VW 维也纳华尔兹、F 狐步、Q 快步\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	◆ 拉丁舞系列：C 恰恰恰、R 伦巴、J 牛仔、S 桑巴、P 斗牛\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	5支舞：标准舞：W、T、VW、F、Q；拉丁舞：S、C、R、J、P 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	4支舞：标准舞：W、T、VW、Q；拉丁舞：S、C、R、J 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	3支舞：标准舞：公开组W、T、VW&lt;b&gt;&lt;span&gt;（少年组&lt;/span&gt;W、Q、VW）&lt;/b&gt;&lt;span&gt;；&lt;/span&gt; &lt;span&gt;拉丁舞：&lt;/span&gt;C、R、J 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:19.2500pt;&quot;&gt;\r\n	2支舞：标准舞：公开组W、T；少年组W、Q；拉丁舞：C、R 。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;九、竞赛规定：&lt;/b&gt;&lt;b&gt;&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;1、&lt;/b&gt;&lt;b&gt;&lt;span&gt;锦标赛组别注明：不足&lt;/span&gt;6对选手参赛，比赛不发奖金；不足3对选手参赛，比赛取消。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	2、13岁或以下年龄组的服装和动作按规定执行。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:25.6000pt;&quot;&gt;\r\n	3、参加颁奖仪式选手须着比赛服装。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	4、参加各年龄组比赛的选手，必须随身携带身份证或户口本原件备查。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.6500pt;&quot;&gt;\r\n	&lt;b&gt;5、比赛期间不接受选手投诉，投诉必须于比赛后由领队缴交500元投诉费，并以书面形式交仲裁委员会处理，投诉失败则不退还投诉费。&lt;/b&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.5500pt;&quot;&gt;\r\n	6、参赛运动员禁用违禁药物。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:25.5500pt;&quot;&gt;\r\n	7、参赛运动员须由组队单位（或个人）购买比赛当日的意外保险；&lt;b&gt;谢绝患有疾病，特别是心脑血管及高血压疾病患者参赛&lt;/b&gt;；&lt;span&gt;若隐瞒病情参赛，则比赛期间一切意外事故的责任由选手自负，大赛组委会不承担任何后果及责任。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;b&gt;十、本竞赛规程最终解释权属主办单位，未尽事宜，另行通知。&lt;/b&gt; \r\n&lt;/p&gt;','13312341234',1481472000,1485273600,1482076800,1482508800,1483113600,16,1481767631,1483713696),(6,'测试赛事','&lt;p&gt;\r\n	2016/01/03添加的测试赛事\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;img src=&quot;/Uploads/2017-01-03/586baa4490c80.jpg&quot; alt=&quot;&quot; /&gt;\r\n&lt;/p&gt;','18672197927',1483450960,1483804800,1483977600,1484841600,1483891200,1,1483450992,1483450992);

/*Table structure for table `qo_payments` */

DROP TABLE IF EXISTS `qo_payments`;

CREATE TABLE `qo_payments` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `pay_number` varchar(40) NOT NULL COMMENT '支付单号',
  `match_entry_id` int(10) NOT NULL DEFAULT '0' COMMENT '赛事报名的ID（match_entrys表ID）',
  `amount` decimal(20,2) DEFAULT '0.00' COMMENT '支付总额',
  `method_id` tinyint(2) DEFAULT '0' COMMENT '支付方式：0为微信支付；1为线下转账（即管理员审核）',
  `pay_status` tinyint(2) DEFAULT '0' COMMENT '支付状态，0为未支付，1为已支付',
  `created_at` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `paid_at` int(10) DEFAULT '0' COMMENT '支付时间',
  `remark` text COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `pay_number` (`pay_number`),
  KEY `match_entry_id` (`match_entry_id`),
  KEY `pay_status` (`pay_status`),
  KEY `method_id` (`method_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='赛事支付表';

/*Data for the table `qo_payments` */

/*Table structure for table `qo_players` */

DROP TABLE IF EXISTS `qo_players`;

CREATE TABLE `qo_players` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '选手ID',
  `type` tinyint(2) DEFAULT '0' COMMENT '选手类型；0为个人（需实名认证）；1为参队团体(报名团体舞专用)',
  `name` varchar(40) NOT NULL COMMENT '选手姓名；如type为1，则为参赛团体名称',
  `idcard` varchar(20) NOT NULL COMMENT '选手身份证号，如type为1，则生成一个唯一的串号（参考函数）',
  `sex` tinyint(2) DEFAULT '0' COMMENT '选手性别，0为未知，1为男，2为女；如type为1，则此值为0',
  `birthday` date DEFAULT NULL COMMENT '选手生日 YYYY-MM-DD，如type为1，则此值为添加的年月日',
  `address` varchar(100) DEFAULT '' COMMENT '身份证地址信息',
  `created_at` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idcard` (`idcard`),
  KEY `birthday` (`birthday`),
  KEY `sex` (`sex`),
  KEY `type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=1385 DEFAULT CHARSET=utf8mb4 COMMENT='选手表（必须实名认证通过的人才可写入此表）';

